import { createSelector } from 'reselect';

const selectHiDomain = state => state.get('Hi').toJS();
const selectHi = () => createSelector(
  selectHiDomain(),
  hiState => hiState.get('hi'),
)

export {
  selectHiDomain,
  selectHi,
}
